import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";

class WEIXIN extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (<Fragment><div className={"WEIXINcolocr"}>
            <img className={"WEIXINimg"} alt={"标本"} src={"hongpeibang/img/qrcode_for_gh_98d29a03a480_860.jpg"}/>
        </div>
        </Fragment>)
    }

}

export default withRouter(WEIXIN);
